        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "Volgens de Vietnamese wetgeving kan informatie van gebruikers, zoals namen, e-mailadressen, wachtwoorden en geboortedatum, worden geclassificeerd als \'persoonlijke informatie\'.\n\n Met name,\n (a) Volgens Decreet 72/2013 wordt persoonlijke informatie gedefinieerd als informatie die is gekoppeld aan de identificatie van de identiteit en persoonlijke gegevens van een persoon, inclusief naam, leeftijd, adres, identiteitskaartnummer van de persoon, telefoonnummer, e-mailadres en andere informatie zoals bepaald door de wet\n\n (b) Volgens circulaire 25/2010 betekent persoonlijke informatie informatie die voldoende is om een persoon nauwkeurig te identificeren, waaronder ten minste een van de volgende details: volledige naam, geboortedatum, beroep, titel, contactadres, e-mailadres, telefoonnummer, identiteit kaartnummer en paspoortnummer. Informatie over persoonlijke privacy omvat het gezondheidsdossier, het betalingsoverzicht van de belasting, het nummer van de sociale verzekeringskaart, het creditcardnummer en andere persoonlijke geheimen.\n\n Circulaire 25 is van toepassing op het verzamelen en gebruiken van persoonlijke informatie door websites die worden beheerd door Vietnamese overheidsinstanties. Circulaire 25 is niet rechtstreeks van toepassing op het verzamelen en gebruiken van persoonlijke informatie door websites die worden beheerd door niet-overheidsinstanties. De bepalingen van circulaire 25 zouden echter naar analogie kunnen worden toegepast. Bovendien is het waarschijnlijk dat een niet-gouvernementele entiteit onderworpen zal zijn aan dezelfde of strengere normen dan die welke van toepassing zijn op een overheidsentiteit."),
